import React, { Component } from 'react'
import { Menu, Icon } from 'antd'

export default class Nav extends Component {
  state = {
    current: 'user',
  };

  handleClick = e => {
    console.log('click ', e);
    this.setState({
      current: e.key,
    });
  };

  logOut = () => {
    this.props.history.push('/login')
    this.context.logOut()
  }

  render() {
    return (
      <Menu onClick={this.handleClick} selectedKeys={[this.state.current]} mode="horizontal">
        <Menu.Item key="home">
          <Icon type="home" />
          Home
        </Menu.Item>
        <Menu.Item key="user">
          <Icon type="user" />
          User
        </Menu.Item>
        <Menu.Item key="logout" onSelect={this.logOut}>
          <Icon type="logout" />
          Logout
        </Menu.Item>
      </Menu>
    )
  }
}
